<!-- Plan Narrative & Structure: This design adopts a dark, professional theme with a clean, single-column layout for a streamlined, focused user experience. The sections are presented sequentially to tell a clear story, from the overall expertise and core competencies to specific service details. Visualizations are placed prominently within each section to support the narrative. This structure is designed for straightforward, top-to-bottom reading on any device. -->
<!-- Select Optimal Visualizations:
- KPIs (5+, 100+, 98%): Goal: Inform -> Visualization: Large text numbers in styled cards -> Justification: Immediate impact and clear communication of key metrics. Method: HTML/CSS. NO SVG.
- Core Competencies Data: Goal: Compare (Composition) -> Visualization: Donut Chart -> Justification: Excellent for showing how each service contributes to the whole. Library: Chart.js/Canvas. NO SVG.
- Material Handling Data: Goal: Compare (Categories) -> Visualization: Bar Chart -> Justification: Best for direct comparison of project distribution across different categories. Library: Chart.js/Canvas. NO SVG.
- Automated Material Flow: Goal: Organize (Process) -> Visualization: Flow Chart -> Justification: Visually represents a sequential process clearly and intuitively. Method: HTML/CSS with Tailwind Flexbox. NO SVG/Mermaid JS.

    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Arnav Engineering Services Infographic</title>

    <style>
        body {
            font-family: 'Roboto', sans-serif;
            background-color: #1a1a1a;
            color: #e0e0e0;
        }
        .chart-container {
            position: relative;
            width: 100%;
            max-width: 600px;
            margin-left: auto;
            margin-right: auto;
            height: 350px;
            max-height: 400px;
        }
        @media (min-width: 768px) {
            .chart-container {
                height: 400px;
            }
        }
        .section-card {
            background-color: #2a2a2a;
            border-radius: 1rem;
            box-shadow: 0 4px 6px -1px rgba(0, 0, 0, 0.1), 0 2px 4px -2px rgba(0, 0, 0, 0.1);
            padding: 2.5rem;
            margin-bottom: 2rem;
        }
        .kpi-card {
            background-color: #ffc72c;
            color: #1a1a1a;
            border-radius: 1rem;
            box-shadow: 0 4px 6px -1px rgba(0, 0, 0, 0.1), 0 2px 4px -2px rgba(0, 0, 0, 0.1);
            padding: 2rem;
            text-align: center;
        }
        .flow-step {
            display: flex;
            align-items: center;
            justify-content: center;
            text-align: center;
            padding: 1rem;
            border-radius: 0.5rem;
            color: #1a1a1a;
            background-color: #ffc72c;
            min-height: 80px;
            font-weight: 600;
            box-shadow: 0 4px 6px -1px rgb(0 0 0 / 0.1), 0 2px 4px -2px rgb(0 0 0 / 0.1);
        }
        .flow-arrow {
            font-size: 2rem;
            margin: 0 1rem;
            color: #e0e0e0;
        }
    </style>
</head>
